import * as React from 'react';
import {HTMLImgProps} from '@root/components/core/common';

const herissonBase64 =
  'data:image/png;base64,';

export class Herisson extends React.Component<HTMLImgProps, {}> {
  public static displayName = 'Herisson';

  public render(): JSX.Element {
    return <img {...this.props} src={herissonBase64} />;
  }
}
